import logo from './logo.svg';
import './App.css';

import {Login} from './components/Login';
import {HomeUser} from './components/HomeUser';

function App() {
  return (
    <div className="container" id='login'>
      <Login />
      <div><HomeUser id='HomeUser'/></div>
    </div>
    
  );
}

export default App;
